import React, { Dispatch } from 'react';
import { DispatchType, State } from 'types/types';


type PropsP = {
    state: State;
    dispatch: Dispatch<DispatchType>;
  };
  export const Context = React.createContext<PropsP>({
    state: { isOpenModal: false, loading: true },
    dispatch: () => {}
  });
